package crap.util.imgs;

import java.io.File;
import java.io.FileInputStream;
import java.io.FileNotFoundException;
import java.io.FileOutputStream;
import java.io.IOException;
import org.apache.commons.codec.binary.Base64;

/**
 *
 * @author JOVIR
 */
public class ConvertBase64String2Img {

    public static void main(String[] args) throws FileNotFoundException, IOException {
        String data = ","; //"data:image/png;base64,";
        String base64Image;// = data.split(",")[1];
        File f = new File("C:\\Users\\jovir\\Downloads\\struk.jpg");
        base64Image = encodeFileToBase64Binary(f);

        byte[] imageBytes = javax.xml.bind.DatatypeConverter.parseBase64Binary(base64Image);

        FileOutputStream fos = new FileOutputStream("C:\\Users\\jovir\\Desktop\\_temp\\image.jpg");
        try {
            fos.write(imageBytes);
        } finally {
            fos.close();
        }
    }

    private static String encodeFileToBase64Binary(File file) {
        String encodedfile = null;
        try {
            FileInputStream fileInputStreamReader = new FileInputStream(file);
            byte[] bytes = new byte[(int) file.length()];
            fileInputStreamReader.read(bytes);
            encodedfile = new String(Base64.encodeBase64(bytes), "UTF-8");
        } catch (FileNotFoundException e) {
            // TODO Auto-generated catch block

        } catch (IOException e) {
            // TODO Auto-generated catch block

        }

        return encodedfile;
    }
}
